// App.js
import React, { Suspense } from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import BubbleChartPage from './components/staticData/BubbleChartPage'
import MainPage from './components/mainPage/MainPage'
import NavBar from './components/NavBar/NavBar'
import './App.css'
import SunburstChartPage from './components/staticData/SunburstChartPage'
import TypePage from './components/staticData/TypePage'
import EventTypePage from './components/staticData/EventTypePage'
import OverviewPage from './components/staticData/OverviewPage'
import WordCloudPage from './components/staticData/WordCloudPage'
import ExperiencePage from './components/staticData/ExperiencePage'
import { FileProvider } from './components/utils/FileContext'

function App() {
  return (
    <FileProvider>
      <Suspense fallback={<h1>Aguarda um pouco sff </h1>}>
        <Router>
          <div className="app-container">
            <NavBar />
            <Routes>
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/"
                element={<MainPage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/overview"
                element={<OverviewPage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/wordcloud"
                element={<WordCloudPage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/types"
                element={<TypePage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/eventTypes"
                element={<EventTypePage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/trial"
                element={<BubbleChartPage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/bubble"
                element={<BubbleChartPage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/sunburst"
                element={<SunburstChartPage />}
              />
              <Route
                key={fileChanged ? 'fileChanged' : 'default'}
                path="/experience/:id"
                element={<ExperiencePage />}
              />
            </Routes>
          </div>
        </Router>
      </Suspense>
    </FileProvider>
  )
}

export default App
